// Photography.jsx
import React, { useEffect } from 'react';
import './Photography.css';

const Photography = () => {
  useEffect(() => {
    // Define the embed script
    const embedScript = `
    <script type="text/javascript" src="https://www.redbubble.com/assets/external_portfolio.js"></script>
    <script id="rb-xzfcxvzx" type="text/javascript">new RBExternalPortfolio('www.redbubble.com', 'krood16', 3, 3).renderIframe();
    </script>
    `;

    // Create a container for the embed script
    const container = document.createElement('div');
    container.innerHTML = embedScript;

    // Append the container to the body
    document.body.appendChild(container);

    // Cleanup: remove the container when the component unmounts
    return () => {
      document.body.removeChild(container);
    };
  }, []);

  return (
    <div className="photography">
      <h1>Photography</h1>
      
      {/* Embed Redbubble Portfolio */}
      <div id="rb-embed-container" className="embed-container"></div>
    </div>
  );
};

export default Photography;
